!function(){Template.__checkName("information"),Template.information=new Template("Template.information",function(){var e=this;return Spacebars.include(e.lookupTemplate("markdown"),function(){return"\n\n# About the game\n\nThis game is built for StaticShowdown 2015. THe game is powered by mainly Meteor, Iron:Router, SnapSVG, FontAwesome, Animate.css, SweetAlerts and some stuff like Javascript and HTML. The game is targeted at beginners but experienced users can give it a shot just for fun.\n\n  "})})}();

!function(){Template.__checkName("instructions"),Template.instructions=new Template("Template.instructions",function(){var e=this;return Spacebars.include(e.lookupTemplate("markdown"),function(){return'\n\n# Instructions\n\nHi, in this game you\'re going to write simple programs to guide this snake to it\'s goals. After selecting a level, use the code editor to enter some commands to collect all fruits avoiding obstacles.\n\n# User Interface\n\nDifferent parts of the game can be accessed using the footer. Any sections can be visited at any time without losing progress.\n\n## <small><i class="fa fa-bars"></i></small> Levels Map\n\nFrom here, you can start game levels. Click on a button to start that level. First 6 levels are tutorials which explains different parts of the game. All following levels are puzzles.\n\n## <small><i class="fa fa-code"></i></small> Rule Editor\n\nFrom here you can add, modify or remove commands the snake is going to follow. Any number of commands can be given but commands cost time. Each level has a limited time to complete the goal.\n\n## <small><i class="fa fa-play"></i></small> Game Preview\n\nThe game will automatically start executing instructions when user goes to this view.\n\n\nThis is the rule editor, from here you can give some instructions to the snake. To come back here, click on the <strong><i class="fa fa-code"></i></strong> icon on the footer. After programming the snake, click on the play button on the footer to see how it goes. Before checking it out, give the snake some commands.,\n\n  '})})}();

